function indexOfPokemons(pokemon, pokemons) {
	if (!showPokemon(pokemon)) {
		return 0;
	} else {
		for (var i = 0; i < pokemons.length; ++i) {
			var currentPokemon = pokemons[i];
			if (pokemon.isEqual(currentPokemon)) {
				return i;
			}
		}
	}
	return -1;
}

